// CyberPlat

/**
 * Fix price format.
 * @param {string} price - amount of payment
 */
function fixPrice(price) {
	var fullPrice = price.split(".");
	if (fullPrice.length > 1) {
		var currency = parseInt(fullPrice[0]);
		var fractional = fullPrice[1].length > 1 ? parseInt(fullPrice[1]) : parseInt(fullPrice[1])*10;
	} else {
		var currency = Math.floor(price/100);
		var fractional = Math.floor(price - currency*100);
	}
	fractional = fractional < 10 ? "0" + fractional : fractional;
	return currency + "." + fractional;
}

/**
 * Fix link format.
 * @param {string} checkurl - url of shop
 */
function fixLink(checkurl){
	var matches = unescape( checkurl ).match( /http[s]?\:\/\/([^\/]+)/ );
	if (matches){
		return matches[1];
	} else {
		return null;
	}
}

/**
 * Timer.
 */
var CountDown = function()
{        
    // Property: Frequency of elapse event of the timer in millisecond
    this.rate = 1000;
	// Property: Time
	this.seconds = 0;
	this.minutes = 15;
	// Member variable: Object to show numbers
	this.face = document.getElementById('timer');
    // Property: Whether the timer is enable or not
    this.Enable = new Boolean(false);
	// Event: Timer stop
    this.timeOut;
    // Member variable: Hold interval id of the timer
    var timerId = 0;
    // Member variable: Hold instance of this class
    var self;
	
    // Start the timer
    this.Start = function(){
        this.Enable = new Boolean(true);
        self = this;
		
        if (self.Enable)
        {
            self.timerId = setInterval(
				function(){self.Tick();},
				self.rate
			);
        }
    };
	
	// Stops the timer
    this.Stop = function(){            
        self.Enable = new Boolean(false);
        clearInterval(self.timerId);
    };
	
	// Tick tock
	this.Tick = function(){
		if (self.seconds <= 0 ){
			self.seconds = 60;
			self.minutes--;
		} 
		if (self.minutes <= -1){ 
			self.Stop();
			self.timeOut();
		} else {
			self.seconds--;
			self.face.innerHTML = (self.minutes.toString().length == 1 ? '0' : '') + self.minutes + ' : ' + (self.seconds.toString().length  == 1 ? '0' : '') + self.seconds;
		}
	}
};

