function cardType(cardNumber) {
    if (cardNumber == null) {
        return undefined;
    }

    // remove all unnecessary
    cardNumber = cardNumber.replace(/[^\d.]/g, '');

    // 222100272099: MasterCard
    var bin = cardNumber.substring(0, 6);
    if (bin >= '222100' && bin <= '272099') {
        return 'EU';
    }

    // issuer identification numbers
    // CM - maestro, VI - visa, EU - mastercard, MI - mir
    var iin = {
        VI: /^4/,
        MI: /^2/,
        CM: /^(?:5\d{16,}|6)/,
        EU: /^5\d{15}$/
    };

    // checking
    for (var key in iin) {
        if (iin[key].test(cardNumber)){ return key; }
    }
    return undefined;
}



 
